import React, { Component } from "react";
import { MDBNavbar, MDBNavbarBrand } from "mdbreact";
import styled from 'styled-components';

const Wrapper = styled.div`
.brand{
    height: 40px;
    width: 40px;
    margin: 0;
    padding-top: 0;
    padding-bottom: 0;
    font-size: 28px;

    text-align: center;
  }

  .brand-text{
    position: absolute;
    font-family: "Lobster Two", cursive;
    top: 12px;
    left: 20px;
  }
`;

class Navbar extends Component {

render() {
  return (
    <MDBNavbar fixed="top" color="red" className="navbar" dark expand>
    <MDBNavbarBrand className="brand">
      <span className="brand-text">L</span>
    </MDBNavbarBrand>
  </MDBNavbar>
    );
  }
}

export default Navbar;
